import React from 'react';
import PropTypes from 'prop-types';

const About = ({ 
  votesCount, 
  commentsCount, 
  viewsCount, 
  dailyFeedPosition, 
  weeklyFeedPosition 
}) => {
    return (
      <>
        <h4>About this launch</h4>
        <div className="about">
          <div className="element">
            <div>
              Upvotes 
              <div>{votesCount}</div>
            </div>
          </div>
          <div className="element">
            <div>
              Comments
              <div>{commentsCount}</div>
            </div>
          </div>
          <div className="element">
            <div>
              Views 
              <div>{viewsCount}</div>
            </div>
          </div>
          <div className="element">
            Daily Rank 
            <div>
              #{dailyFeedPosition}
            </div>
          </div>
          <div className="element">
            Weekly Rank 
            <div>
              #{weeklyFeedPosition}
            </div>
          </div>
        </div>
      </>
    )
}

